import logo from '../logo.svg';
import '../App.css';
import Greet from './Greet';
import Message from './Message'; 
import Button from './Button';
import Hello from './Hello';
import Employee from './Employee';


function Home() {
  return (
    <div className="Home">
      <header className="App-header">
        <img src="https://www.vhv.rs/dpng/d/480-4805801_olympics-gymnastics-png-transparent-png.png"className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <p>{Hello}</p>
        <Greet name="Heeseung" positionName = "Center">
          <Message/>
          </Greet>
          <Greet name="Jake" positionName = "Lead Rapper">
        <Button/>
        </Greet>
        <Greet name= "Sunoo" positionName = "Lead Vocal"/>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default Home;
